var editorField2 = CodeMirror.fromTextArea(document.getElementById("areaTexto"), {
    lineNumbers: true,
    mode: "javascript",
    theme: "dracula" //tema a 'dracula'
});
editorField2.setOption("scrollbarStyle", null);

var editorField3 = CodeMirror.fromTextArea(document.getElementById("jsonOutput"), {
    lineNumbers: true,
    mode: "javascript",
    theme: "dracula", //tema a 'dracula'
    readOnly: true // Hacer el editor de solo lectura
});
editorField3.setOption("scrollbarStyle", null);

function populateSelect() {
    var select = document.getElementById('selectNames');
    jsonData.forEach(function (item) {
        var option = document.createElement('option');
        option.value = item.nombre;
        option.text = item.nombre;
        select.appendChild(option);
    });
}

function selectJSON() {
    var select = document.getElementById('selectNames');
    var selectedValue = select.options[select.selectedIndex].value;
    var selectedObject = jsonData.find(function (item) {
        return item.nombre === selectedValue;
    });
    editorField2.setValue(JSON.stringify(selectedObject.json, null, 2));

    // Setear la descripción en el elemento con ID "description"
    document.getElementById("description").innerText = selectedObject.descripcion || "No hay descripción disponible";
}

function printResoponseOfRequest(responde) {

    editorField3.setValue(JSON.stringify(responde, null, 2));

}

function sendRequest() {

    const procedureName = document.getElementById("selectNames").value;

    const bodyRequest = editorField2.getValue();

    // Definir la URL a la que enviar la petición
    const url = '/Request/' + procedureName;

    // Configurar la petición fetch con el método POST y los datos
    fetch(url, {
        method: 'POST', // Método HTTP
        headers: {
            'Content-Type': 'application/json', // Indicar el tipo de contenido
        },
        body: bodyRequest // Convertir los datos a una cadena JSON
    })
        .then(response => response.json()) // Convertir la respuesta a JSON
        .then(data => printResoponseOfRequest(data)) // Manejar la respuesta
        .catch(error => console.error('Error:', error)); // Manejar el error

}

function sendRequestCloseSession() {

    const procedureName = document.getElementById("selectNames").value;

    const bodyRequest = editorField2.getValue();

    // Definir la URL a la que enviar la petición
    const url = '/Request/' + procedureName;

    // Configurar la petición fetch con el método POST y los datos
    fetch(url, {
        method: 'POST', // Método HTTP
        headers: {
            'Content-Type': 'application/json', // Indicar el tipo de contenido
        },
        body: bodyRequest // Convertir los datos a una cadena JSON
    })
        .then(response => response.json()) // Convertir la respuesta a JSON
        .then(data => printResoponseOfRequest(data)) // Manejar la respuesta
        .catch(error => console.error('Error:', error)); // Manejar el error

}



populateSelect();

var miBoton = document.getElementById('sendRequest');

miBoton.addEventListener('click', function () {
    sendRequest();
});

var closeSessionBoton = document.getElementById('closeSession');

closeSessionBoton.addEventListener('click', function () {
    alert("cerrar sesion ");
});
